import React from 'react';
import { ThemeProvider } from 'theme-ui'

import { Flex, Box } from 'reflexbox';

import theme from '../theme'

const Navigation = () => (
    <Flex justifyContent='space-between' fontFamily='body'>
        <Box>
            <b>votsec</b>
        </Box>
    </Flex>
);

const App = () => (
    <ThemeProvider theme={theme}>
        <Navigation />
    </ThemeProvider>
);

export default App;
